package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that when specialties is already initialized, it returns the existing set")
	void testGetSpecialtiesInternalWhenSpecialtiesIsInitialized() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Ensures the returned set is never null")
	void testGetSpecialtiesInternalReturnsNonNullSet() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns a list of specialties sorted by name")
	void testGetSpecialtiesReturnsSortedList() {
		var result = instance.getSpecialties();
		assertEquals(null, result);
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns an empty list when no specialties are added")
	void testGetSpecialtiesReturnsEmptyListWhenNoSpecialties() {
		var result = instance.getSpecialties();
		assertTrue(result.isEmpty());
	}

	@Test
	@DisplayName("Verifies adding a specialty then retrieving the sorted list")
	void testAddSpecialtyAndGetSpecialties() {
		var result = instance.getSpecialties();
		assertEquals(null, result);
	}

	@Test
	@DisplayName("Verifies getNrOfSpecialties returns the correct count of specialties")
	void testGetNrOfSpecialtiesReturnsCount() {
		var result = instance.getSpecialties();
		assertEquals(2, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns the correct count when two specialties are added to the Vet")
	void testGetNrOfSpecialtiesReturnsTwoWhenTwoSpecialtiesAdded() {
		var result = instance.getNrOfSpecialties();
		assertEquals(2, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns 0 when no specialties are added to the Vet")
	void testGetNrOfSpecialtiesReturnsZeroWhenNoSpecialtiesAdded() {
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns 1 when one specialty is added to the Vet")
	void testGetNrOfSpecialtiesReturnsOneWhenOneSpecialtyAdded() {
		var result = instance.getNrOfSpecialties();
		assertEquals(1, result);
	}

	@Test
	@DisplayName("Verifies that a Specialty is successfully added to the Vet's specialties list")
	void testAddSpecialtyHappyPath() {
		instance.addSpecialty(new Vet());
	}

	@Test
	@DisplayName("Verifies that passing null as specialty does not add anything and handles gracefully")
	void testAddSpecialtyWithNull() {
		instance.addSpecialty(new Vet());
	}

	@Test
	@DisplayName("Verifies behavior when adding the same Specialty instance again, assuming it's a Set")
	void testAddSpecialtyDuplicate() {
		instance.addSpecialty(new Vet());
	}

}
